import React from 'react';
import './App.css';
import Header from "./components/Header";
import Navigation from "./components/Navigation";
import MainSection from "./components/MainSection";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="App">
      <Header />
      <Navigation />
      <MainSection />

      <Services />
      <Portfolio />
      <Testimonials />
      <ContactUs />

      <Footer />
    </div>
  );
}

export default App;
